import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { normalize } from "./hooks/normalize";
import { QueryClient, QueryClientProvider, useQuery } from "react-query";

const queryClient = new QueryClient();

function App() {
  const { isLoading, error, data } = useQuery("users", () =>
    fetch(
      "https://api.openweathermap.org/data/2.5/weather?q=cologne&appid=cf61ba7bba440089d7c442c97d356595"
    )
      .then((res) => res.json())
      .then((data) => normalize(data))
  );

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {data ? <p>{data.name}</p> : null}
        {data?.extras?.map((item) => (
          <p key={item}>{item}</p>
        ))}
        {data?.top ? <p>{data?.top}</p> : undefined}
        {data?.legs ? <p>{data?.legs}</p> : undefined}
        {data?.bottom ? <p>{data?.bottom}</p> : undefined}
      </header>
    </div>
  );
}

export default App;
